const TrashIcon = () => {
  return (
    <svg
    version="1.1"
    id="Capa_1"
    xmlns="http://www.w3.org/2000/svg"
    viewBox="0 0 50 50"
    width="20px"
    height="20px"
    fill="#000000"
    stroke="#000000"
  >
    <g id="SVGRepo_bgCarrier" stroke-width="0"></g>
    <g id="SVGRepo_tracerCarrier" stroke-linecap="round" stroke-linejoin="round"></g>
    <g id="SVGRepo_iconCarrier">
      <circle style={{ fill: "#506b6d" }} cx="25" cy="25" r="25"></circle>
      <polyline
        style={{
          fill: "none",
          stroke: "#506b6dFFFFFF",
          strokeWidth: "5",
          strokeLinecap: "round",
          strokeMiterlimit: "10",
        }}
        points="16,34 25,25 34,16"
      ></polyline>
      <polyline
        style={{
          fill: "none",
          stroke: "#506b6dFFFFFF",
          strokeWidth: "5",
          strokeLinecap: "round",
          strokeMiterlimit: "10",
        }}
        points="16,16 25,25 34,34"
      ></polyline>
    </g>
  </svg>
  

  );
};

export default TrashIcon;
